export default function FileSelect({ socket }) {

    let fileNames = [];
    socket.emit("get_files", (files) => {
        fileNames = files.message.map((file) => {
            <option>{file}</option>
        });
    });

    return (
        <div className="file-select" >
            <select>
                fileNames
                <option>test1</option>
            </select>
            <button type="submit">Upload</button>
        </div>
    );
}
